import React, { useState } from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import CssBaseline from "@material-ui/core/CssBaseline";
import TextField from "@material-ui/core/TextField";
import { Link } from "react-router-dom";
import Grid from "@material-ui/core/Grid";
import GroupIcon from "@material-ui/icons/Group";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Checkbox from 'react-simple-checkbox';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import { useHistory } from "react-router-dom";
import DatePicker from 'react-datepicker';
import { withStyles } from "@material-ui/core/styles";
import {BrowserRouter, Route} from 'react-router-dom';


const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

const Copyright = () => {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" to="https://material-ui.com/">
        SVUDDE
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const routeChange = () => { 
  // let path = `/home`; 
  //eslint-disable-next-line no-restricted-globals
  history.push("/home");
}

class ApplicationForm extends React.Component {

  constructor(props) {
    super(props);



    this.handleFormSubmit = this.handleFormSubmit.bind(this);
  }
  state = {
    courseApplied: "",
    studyCenterOptedCode: "",
    name: "",
    fatherName: "",
    aadharNo: "",
    doorNo: "",
    street: "",
    village: "",
    mandal: "",
    district: "",
    pincode: "",
    email: "",
    gender: "",
    medium: "",
    secondLanguageOpted: "",
    dob: new Date("1978-04-02T21:11:54"),
    maritalStatus: "",
    nationality: "",
    religion: "",
    caste: "",
    residential: "",
    phCategory: "",
    qualifyingExamination: "",
    university: "",
    yearAndMonthPasssing: new Date("1978-04-02T21:11:54"),
    groupSubject: "",
    maxMarks: "",
    marksObtained: "",
    percentageOfMarks: "",
    feeAmount: "",
    challanId: "",
    challanDate: new Date("2021-01-01T21:11:54"),
    bankName: "",
    declarationChecked: ""
  }

  logoutHandler =(e) => {
    this.props.history.push('/login')
  }

  handleCouseApplied = (courseApplied) => {
    this.setState({
      courseApplied: courseApplied
    })
  }

  handleStudyCenterOptedCode = (codeOpted) => {
    this.setState({
      studyCenterOptedCode: codeOpted
    })
  }

  handleNameChange = (name) => {
    this.setState({
      name: name
    })
  }

  handleFatherName = (fatherName) => {
    this.setState({
      fatherName: fatherName
    })
  }

  handleAadharNo = (aadharNo) => {
    this.setState({
      aadharNo: aadharNo
    })
  }

  handleDoorNo = (doorNo) => {
    this.setState({
      doorNo: doorNo
    })
  }

  handleStreet = (street) => {
    this.setState({
      street: street
    })
  }

  handleVillage = (village) => {
    this.setState({
      village: village
    })
  }

  handleMandal = (mandal) => {
    this.setState({
      mandal: mandal
    })
  }

  handleDistrict = (district) => {
    this.setState({
      district: district
    })
  }

  handlePincode = (pincode) => {
    this.setState({
      pincode: pincode
    })
  }

  handleEmail = (email) => {
    this.setState({
      email: email
    })
  }

  handleGenderChange = (gender) => {
    this.setState({
      gender: gender
    })
  }

  handleMedium = (medium) => {
    this.setState({
      medium: medium
    })
  }

  handleSecondLanguageOpted = (secondLanguageOpted) => {
    this.setState({
      secondLanguageOpted: secondLanguageOpted
    })
  }

  handleDOB = (dob) => {
    this.setState({
      dob: dob
    })
  }

  handleMaritalStatus = (maritalStatus) => {
    this.setState({
      maritalStatus: maritalStatus
    })
  }

  handleNationality = (nationality) => {
    this.setState({
      nationality: nationality
    })
  }

  handleReligion = (religion) => {
    this.setState({
      religion: religion
    })
  }

  handleCaste = (caste) => {
    this.setState({
      caste: caste
    })
  }

  handleResidential = (residential) => {
    this.setState({
      residential: residential
    })
  }

  handlePhCategory = (phCategory) => {
    this.setState({
      phCategory: phCategory
    })
  }

  handleQualifyingExam = (qualifyingExamination) => {
    this.setState({
      qualifyingExamination: qualifyingExamination
    })
  }

  handleUniversity = (university) => {
    this.setState({
      university: university
    })
  }

  handleYearAndMonth= (yearAndMonthPassing) => {
    this.setState({
      yearAndMonthPassing: yearAndMonthPassing
    })
  }

  handleGroupSubject = (groupSubject) => {
    this.setState({
      groupSubject: groupSubject
    })
  }

  handleMaxMarks = (maxMarks) => {
    this.setState({
      maxMarks: maxMarks
    })
  }

  handleMarksObtained = (marksObtained) => {
    this.setState({
      marksObtained: marksObtained
    })
  }

  handlePercentageOfMarks = (percentageOfMarks) => {
    this.setState({
      percentageOfMarks: percentageOfMarks
    })
  }

  handleFeeAmount = (feeAmount) => {
    this.setState({
      feeAmount: feeAmount
    })
  }

  handleChallanId = (chllanId) => {
    this.setState({
      chllanId: chllanId
    })
  }

  handleChallanDate = (challanDate) => {
    this.setState({
      challanDate: challanDate
    })
  }

  handleBankName = (bankName) => {
    this.setState({
      bankName: bankName
    })
  }

  handleDeclarationChecked = (declarationChecked) => {
    this.setState({
      declarationChecked: declarationChecked
    })
  }


  saveApplication = (toInput) => {
    const response = fetch("/svudde/saveForm", {
      method: "POST", // *GET, POST, PUT, DELETE, etc.
      mode: "cors", // no-cors, *cors, same-origin
      cache: "no-cache", // *default, no-cache, reload, force-cache, only-if-cached
      credentials: "same-origin", // include, *same-origin, omit
      headers: {
        "Content-Type": "application/json"
        // 'Content-Type': 'application/x-www-form-urlencoded',
      },
      redirect: "follow", // manual, *follow, error
      referrerPolicy: "no-referrer", // no-referrer, *client
      body: JSON.stringify(toInput) // body data type must match "Content-Type" header
    }).then(response => {
      if(!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      } else {
        console.log("SUCCESS")
        // console.log("Status: OK in Home -> Response: " + JSON.stringify(response.json()));
        // let responseText = document.createElement(response.json());
        // document.body.appendChild(responseText);
      }
    })
    .catch(e => {
      console.log('There has been a problem with the fetch operation: ' + e.message)
    })
  }

  handleFormSubmit = (variables) => {
    variables.preventDefault();
    console.log("Declaration checked" + this.state.declarationChecked)
    const toInput = this.state.gender;
    this.saveApplication(toInput);
  };

  // if (firstLoad) {
  //   // sampleFunc();
  //   setLoad(false);
  // }

  render() {
    const { classes } = this.props;
  return (

    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <BrowserRouter>
                <div>
                    {/* <header>
                        <Link to='/contact'>Contact</Link>
                    </header>
                    <div>
                        <Route path='/contact' Component={Contact}></Route>
                    </div> */}
                    {/* <a href="#" onClick={e=>this.logoutHandler(e)}>Logout</a> */}
                </div>
    </BrowserRouter>
      <div className={classes.paper}>
        <Typography component="h1" variant="h5">
          Admission Application Form
        </Typography>
         <form className={classes.form} noValidate>
        <p>Course and Subject Applied</p>
        <select defaultValue={""} 
            onChange={this.handleCouseApplied} 
        >
          <option value="Couse1">Course1</option>
          <option value="Course2">Course2</option>
          <option value="Course3">Course3</option>
        </select>

        <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="studyCenterId"
            label="Study Center opted with Code No."
            name="name"
            defaultValue="001"
            onChange={this.handleStudyCenterOptedCode}
            autoFocus
          />
        <p>(Only required for applicants from study centers)</p>
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="name"
            label="Name of the Applicant (as per lower degree )"
            name="name"
            autoComplete="name"
            onChange={this.handleNameChange}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="fatherName"
            label="Father's Name"
            name="fatherName"
            autoComplete="fatherName"
            onChange={this.handleFatherName}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="aadharNo"
            label="AADHAR No."
            name="aadharNo"
            autoComplete=""
            onChange={this.handleAadharNo}
            autoFocus
          />
          <p>-- Address for Communication --</p>
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="doorNo"
            label="Door No."
            name="Door No."
            autoComplete="doorNo"
            onChange={this.handleDoorNo}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="street"
            label="Street"
            name="Street"
            autoComplete="street"
            onChange={this.handleStreet}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="village"
            label="Village/Post"
            name="village"
            autoComplete="village"
            onChange={this.handleVillage}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="mandal"
            label="Mandal/Town"
            name="mandal"
            autoComplete="mandal"
            onChange={this.handleMandal}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="district"
            label="District"
            name="district"
            autoComplete="mandal"
            onChange={this.handleDistrict}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="pincode"
            label="Pincode"
            name="pincode"
            autoComplete="pincode"
            onChange={this.handlePincode}
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            onChange={this.handleEmail}
            autoFocus
          />
          <p>Gender</p>
          <select defaultValue={""} 
              onChange={this.handleGenderChange} 
          >
            <option value="M">M</option>
            <option value="F">F</option>
          </select> 

          <p>Medium</p>
          <select defaultValue={""} 
              onChange={this.handleMedium} 
          >
            <option value="English">English</option>
            <option value="Telugu">Telugu</option>
          </select>       
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="secondLanguage"
            label="(a) Second Language Opted under Part-I B:"
            name="secondLanguage"
            autoComplete="secondLanguage"
            onChange={this.handleSecondLanguageOpted}
            autoFocus
          />
          <p>(B.Sc- English Medium only)</p>
          <p>(Only for B.A/B.Com/B.Sc)</p>
          <br></br>

          <Grid item xs={12}>
                        <TextField
                            id="date"
                            label="Date of birth"
                            name="Date of Birth"
                            type="date"
                            defaultValue="1978-04-02"
                            className={classes.textField}
